import React from "react";

const Card = props => {
  return (
    <div className="bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 cn">
      <img alt="photo" src="https://robohash.org/text?150x150" />
      <div>
        <h2>props.id</h2>
        <p>sehbazm@gmail.com</p>
      </div>
    </div>
  );
};

export default Card;
